import React from "react";
import "./Navbar.css";


const Navbar = () => {
  return (
    <div>
      <nav className="navbar navbar-dark bg-light">
        navbar
        <ul>
          <li>Home</li>
          <li>About</li>
          <li>Contact us</li>
        </ul>
      </nav>
    </div>
  );
};

export default Navbar;
